import React, { useState, useEffect } from 'react';
import {
  Container,
  Box,
  TextField,
  Button,
  Typography,
  Paper,
  Alert,
  CircularProgress,
  Link,
  Checkbox,
  FormControlLabel,
  Divider,
  IconButton,
  InputAdornment,
  LinearProgress,
  Tooltip,
  useTheme,
} from '@mui/material';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import GoogleIcon from '@mui/icons-material/Google';
import FacebookIcon from '@mui/icons-material/Facebook';
import TwitterIcon from '@mui/icons-material/Twitter';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';

// Deception detection interface
interface DeceptionMetrics {
  typingSpeed: number[];
  mouseMovements: number[];
  failedAttempts: number;
  lastAttemptTime: number;
}

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
    background: {
      default: '#f5f5f5',
    },
  },
  components: {
    MuiPaper: {
      styleOverrides: {
        root: {
          backgroundImage: 'linear-gradient(rgba(255, 255, 255, 0.9), rgba(255, 255, 255, 0.9))',
        },
      },
    },
  },
});

// Button position styles
const buttonPositions = {
  'shift-left': { transform: 'translateX(-100px)' },
  'shift-top': { transform: 'translateY(-50px)' },
  'shift-right': { transform: 'translateX(100px)' },
  'shift-bottom': { transform: 'translateY(50px)' },
};

function App() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [buttonPosition, setButtonPosition] = useState('');
  const [rememberMe, setRememberMe] = useState(false);
  const [showPassword, setShowPassword] = useState(false);
  const [passwordStrength, setPasswordStrength] = useState(0);
  const [deceptionMetrics, setDeceptionMetrics] = useState<DeceptionMetrics>({
    typingSpeed: [],
    mouseMovements: [],
    failedAttempts: 0,
    lastAttemptTime: 0,
  });

  // Calculate password strength
  useEffect(() => {
    let strength = 0;
    if (password.length >= 8) strength += 25;
    if (password.match(/[A-Z]/)) strength += 25;
    if (password.match(/[0-9]/)) strength += 25;
    if (password.match(/[^A-Za-z0-9]/)) strength += 25;
    setPasswordStrength(strength);
  }, [password]);

  const getPasswordStrengthColor = () => {
    if (passwordStrength <= 25) return 'error';
    if (passwordStrength <= 50) return 'warning';
    if (passwordStrength <= 75) return 'info';
    return 'success';
  };

  // Track typing speed
  useEffect(() => {
    let lastTypingTime = Date.now();
    const handleKeyPress = () => {
      const currentTime = Date.now();
      const timeDiff = currentTime - lastTypingTime;
      setDeceptionMetrics(prev => ({
        ...prev,
        typingSpeed: [...prev.typingSpeed, timeDiff].slice(-10),
      }));
      lastTypingTime = currentTime;
    };

    document.addEventListener('keypress', handleKeyPress);
    return () => document.removeEventListener('keypress', handleKeyPress);
  }, []);

  // Track mouse movements
  useEffect(() => {
    let lastMouseMove = Date.now();
    const handleMouseMove = () => {
      const currentTime = Date.now();
      const timeDiff = currentTime - lastMouseMove;
      setDeceptionMetrics(prev => ({
        ...prev,
        mouseMovements: [...prev.mouseMovements, timeDiff].slice(-10),
      }));
      lastMouseMove = currentTime;
    };

    document.addEventListener('mousemove', handleMouseMove);
    return () => document.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const shiftButton = () => {
    const positions = ['shift-left', 'shift-top', 'shift-right', 'shift-bottom'];
    const currentIndex = positions.indexOf(buttonPosition);
    const nextPosition = positions[(currentIndex + 1) % positions.length];
    setButtonPosition(nextPosition);
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setLoading(true);
    setError('');

    // Simulate API call with deception detection
    try {
      // Check for suspicious patterns
      const avgTypingSpeed = deceptionMetrics.typingSpeed.reduce((a, b) => a + b, 0) / 
        (deceptionMetrics.typingSpeed.length || 1);
      const timeSinceLastAttempt = Date.now() - deceptionMetrics.lastAttemptTime;

      // Update metrics
      setDeceptionMetrics(prev => ({
        ...prev,
        failedAttempts: prev.failedAttempts + 1,
        lastAttemptTime: Date.now(),
      }));

      // Simulate API delay
      await new Promise(resolve => setTimeout(resolve, 1000));

      // Check for suspicious patterns
      if (avgTypingSpeed < 50) { // Suspiciously fast typing
        throw new Error('Suspicious activity detected: Unusual typing pattern');
      }

      if (timeSinceLastAttempt < 2000) { // Too many attempts too quickly
        throw new Error('Too many login attempts. Please wait a moment.');
      }

      // Simulate successful login
      console.log('Login successful');
      setError('Login successful! (Demo only)');
    } catch (err) {
      setError(err instanceof Error ? err.message : 'An error occurred');
    } finally {
      setLoading(false);
    }
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container component="main" maxWidth="xs">
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            minHeight: '100vh',
            background: 'linear-gradient(45deg, #1976d2 30%, #dc004e 90%)',
            padding: 3,
            borderRadius: 2,
          }}
        >
          <Paper
            elevation={3}
            sx={{
              padding: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              width: '100%',
              borderRadius: 2,
              position: 'relative',
              overflow: 'hidden',
            }}
          >
            <Box
              sx={{
                backgroundColor: 'primary.main',
                borderRadius: '50%',
                padding: 2,
                marginBottom: 2,
              }}
            >
              <LockOutlinedIcon sx={{ color: 'white', fontSize: 40 }} />
            </Box>
            <Typography component="h1" variant="h5" sx={{ mb: 3, fontWeight: 'bold' }}>
              login user
            </Typography>
            <Box component="form" onSubmit={handleSubmit} sx={{ mt: 1, width: '100%' }}>
              <TextField
                margin="normal"
                required
                fullWidth
                id="username"
                label="Username"
                name="username"
                autoComplete="username"
                autoFocus
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                sx={{ mb: 2 }}
              />
              <TextField
                margin="normal"
                required
                fullWidth
                name="password"
                label="Password"
                type={showPassword ? 'text' : 'password'}
                id="password"
                autoComplete="current-password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                sx={{ mb: 1 }}
                InputProps={{
                  endAdornment: (
                    <InputAdornment position="end">
                      <IconButton
                        aria-label="toggle password visibility"
                        onClick={() => setShowPassword(!showPassword)}
                        edge="end"
                      >
                        {showPassword ? <VisibilityOff /> : <Visibility />}
                      </IconButton>
                    </InputAdornment>
                  ),
                }}
              />
              {password && (
                <Box sx={{ width: '100%', mb: 2 }}>
                  <LinearProgress
                    variant="determinate"
                    value={passwordStrength}
                    color={getPasswordStrengthColor() as any}
                    sx={{ height: 8, borderRadius: 4 }}
                  />
                  <Typography variant="caption" color="text.secondary" sx={{ mt: 0.5 }}>
                    Password strength: {passwordStrength}%
                  </Typography>
                </Box>
              )}
              <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
                <FormControlLabel
                  control={
                    <Checkbox
                      checked={rememberMe}
                      onChange={(e) => setRememberMe(e.target.checked)}
                      color="primary"
                    />
                  }
                  label="Remember me"
                />
                <Tooltip title="Reset your password">
                  <Link href="/forgot-password" variant="body2" underline="hover">
                    Forgot password?
                  </Link>
                </Tooltip>
              </Box>
              {error && (
                <Alert severity={error.includes('successful') ? 'success' : 'error'} sx={{ mt: 2, mb: 2 }}>
                  {error}
                </Alert>
              )}
              <Box
                sx={{
                  position: 'relative',
                  width: '100%',
                  height: '48px',
                  mt: 3,
                  mb: 2,
                }}
              >
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  disabled={loading}
                  onClick={shiftButton}
                  sx={{
                    position: 'absolute',
                    transition: 'transform 0.3s ease',
                    ...(buttonPosition && buttonPositions[buttonPosition as keyof typeof buttonPositions]),
                    height: '48px',
                    borderRadius: '24px',
                    textTransform: 'none',
                    fontSize: '1.1rem',
                  }}
                >
                  {loading ? <CircularProgress size={24} /> : 'Sign In'}
                </Button>
              </Box>
              <Divider sx={{ my: 3 }}>
                <Typography variant="body2" color="text.secondary">
                  OR
                </Typography>
              </Divider>
              <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2, mb: 2 }}>
                <Tooltip title="Sign in with Google">
                  <IconButton color="primary" aria-label="Google login" sx={{ '&:hover': { transform: 'scale(1.1)' } }}>
                    <GoogleIcon />
                  </IconButton>
                </Tooltip>
                <Tooltip title="Sign in with Facebook">
                  <IconButton color="primary" aria-label="Facebook login" sx={{ '&:hover': { transform: 'scale(1.1)' } }}>
                    <FacebookIcon />
                  </IconButton>
                </Tooltip>
                <Tooltip title="Sign in with Twitter">
                  <IconButton color="primary" aria-label="Twitter login" sx={{ '&:hover': { transform: 'scale(1.1)' } }}>
                    <TwitterIcon />
                  </IconButton>
                </Tooltip>
              </Box>
              <Typography variant="body2" align="center" sx={{ mt: 2 }}>
                Don't have an account?{' '}
                <Link href="/signup" underline="hover" sx={{ fontWeight: 'bold' }}>
                  Create Account
                </Link>
              </Typography>
            </Box>
          </Paper>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
